			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "\nset -e\n\nrelpath()\n{\n    s=$(cd ${1%%/};pwd); d=$(cd $2;pwd); while [ \"${d#$s/}\" == \"${d}\" ]\n    do s=$(dirname $s);b=\"../${b}\"; done; echo ${b}${d#$s/}\n    }\n    \n    #setting PATH\n    PATH=$(bash -l -c 'echo $PATH')\n    \n    echo \"current direct\"\n    pwd\n    \n    TN_EXEC_PATH=\"$TARGET_BUILD_DIR/$EXECUTABLE_PATH\"\n    echo $TN_EXEC_PATH\n    \n    #Temp Android Project Path\n    TN_ANDROID_PROJECT_PATH=\"$TARGET_BUILD_DIR/android\"\n    \n    PRODUCT_IDENTIFIER=`/usr/libexec/PlistBuddy -c \"Print :CFBundleIdentifier\" $TARGET_BUILD_DIR/$INFOPLIST_PATH`\n    echo $ROOT_PRODUCT_IDENTIFIER_PLIST\n    \n    if [[ ! -d $TN_ANDROID_PROJECT_PATH ]]; then\n    mkdir -p $TN_ANDROID_PROJECT_PATH\n    fi\n    \n    pushd $TN_ANDROID_PROJECT_PATH\n    \n    ## create project if needs\n    if [[ ! -f AndroidManifest.xml ]]; then\n    android create project --target 1 --name $PRODUCT_NAME --path ./ --activity MainActivity --package $PRODUCT_IDENTIFIER\n    mkdir -p jni\n    \n    \n    # patch AndroidManifest.xml\n    echo \"patching AndroidManifest.xml..\"\n    cp \"$SRCROOT/$PRODUCT_NAME/AndroidManifest.xml\" ./\n    \n    # patch MainActivity.java\n    echo \"patching MainActivity.java..\"\n    java_dest=`find . -name MainActivity.java`\n    cp \"$SRCROOT/$PRODUCT_NAME/MainActivity.java\" \"$java_dest\"\n    \n    # include CocoaActivity lib\n    \n    SDK_REAL_PATH=`readlink /Applications/Xcode.app/Contents/Developer/Platforms/MacOSX.platform/Developer/SDKs/Android18.sdk`\n    \n    CocoaActivity_PATH=$SDK_REAL_PATH/System/Library/Frameworks/CocoaActivity\n    \n    ##check CocoaActivity exist\n    \n    if [[ ! -d $CocoaActivity_PATH ]]; then\n    echo \"CocoaActivity doesn't exist. please build UIKIt first\"\n    ##clean\n    rm -rf $TN_ANDROID_PROJECT_PATH\n    exit 1\n    fi\n    \n    echo \"Resolving CocoaActivity relative path...\"\n    \n    TN_CURRENT=`pwd`\n    Relative_Library_Path=`relpath $TN_CURRENT $CocoaActivity_PATH`\n    \n    echo \"add CocoaActivity as library...\"\n    android update project --target 1 --path . --library $Relative_Library_Path\n    \n    #update app name\n    sed -i .bak -e \"s/>MainActivity</>$PRODUCT_NAME</\" res/values/strings.xml\n    rm res/values/strings.xml.bak\n    \n    fi\n    \n    #copy jni files\n    echo \"coping jni files..\"\n    cp \"$TN_EXEC_PATH\" \"jni/$EXECUTABLE_NAME.so\"\n    cp \"$SRCROOT/$PRODUCT_NAME/Android.mk\" jni/\n    \n    APP_ABI=armeabi\n    case $TOOLCHAIN_ARCH in\n    arm* | arm)\n    APP_ABI=armeabi\n    ;;\n    x86)\n    APP_ABI=x86\n    ;;\n    *)\n    echo \"Unknow TOOLCHAIN_ARCH:$TOOLCHAIN_ARCH, fallback to arm\"\n    esac\n    \n    echo \"APP_ABI := $APP_ABI\" > jni/Application.mk\n    \n    \n    #copy resources\n    echo \"coping resources...\"\n    mkdir -p assets\n    cp -R \"$TARGET_BUILD_DIR/$UNLOCALIZED_RESOURCES_FOLDER_PATH/\" assets/\n    \n    #build ndk\n    NDK_DEBUG=1 ndk-build\n    \n    popd\n";
		};
